import React, { Component } from 'react';


class Nav extends Component {
    render() {
        return (
            <div className='container-fluid justify-content-center'>
                <div class="row">
                    <div class="col-3 bg-primary">
                        One of three columns
                    </div>
                    <div class="col-6 bg-primary">
                        One of three columns
                    </div>
                    <div class="col-3 bg-primary">
                        One of three columns
                    </div>
                </div>
                <style jsx>
                    {`
                        .auto{
                            display: auto;
                        }
                    `}
                </style>
            </div>
        );
    }
}

export default Nav;
